import React from 'react';

function Projects(props) {
    const head = props.props.head;
    const description = props.props.description;
    // console.log(props.props.head)
    // console.log(props.props.description)
    return (
        <div>
            {head.map((eachHead) => (
                <div>{eachHead}</div>
            ))}
        </div>
        );
}

export default Projects;
